<!DOCTYPE html>
<html style="user-select: none;">
	<head>
		<meta charset="utf-8">
		<title>Power Sheet</title>
		<link rel="stylesheet" href="./Style/style.css" type="text/css"/>
		<link rel="stylesheet" href="./Style/system.css" type="text/css"/>

	</head>
	<body style="margin: 0;">
		<div id="title">Sheet</div>
		<div id="tool">
			<div id="tool-bar">
				<li>File</li>
				<li>Home</li>
				<li>Insert</li>
				<li>Page</li>
				<li>Formulas</li>
				<li>Data</li>
				<li>Review</li>
				<li>View</li>
			</div>
			<div id="cover">
				<div id="cover-bar">
					<li id="cover-bar-return"><svg t="1666413935981" class="icon" viewBox="0 0 1024 1024" version="1.1" xmlns="http://www.w3.org/2000/svg" p-id="12872" width="200" height="200"><path d="M512 945.225143c-238.226286 0-433.225143-194.925714-433.225143-433.225143S273.773714 78.774857 512 78.774857c238.299429 0 433.225143 194.925714 433.225143 433.225143S750.299429 945.225143 512 945.225143M512 0C228.425143 0 0 228.425143 0 512s228.425143 512 512 512 512-228.425143 512-512-228.425143-512-512-512" fill="#ffffff" p-id="12873"></path><path d="M752.274286 476.525714H364.251429l128-128a38.034286 38.034286 0 0 0 0-55.149714 38.034286 38.034286 0 0 0-55.149715 0l-185.051428 183.149714a54.930286 54.930286 0 0 0-15.798857 39.424c0 15.725714 5.851429 29.549714 15.725714 39.350857l185.051428 185.124572a38.912 38.912 0 0 0 27.648 11.849143 34.377143 34.377143 0 0 0 27.574858-13.824 38.034286 38.034286 0 0 0 0-55.149715l-128-128h385.974857c21.650286 0 41.325714-17.700571 41.325714-39.350857a39.497143 39.497143 0 0 0-39.350857-39.424" fill="#ffffff" p-id="12874"></path></svg></li>
					<li>Home</li>
					<li>Open</li>
					<li>New</li>
					<hr>
					<li>Save</li>
					<hr>
					<li>Help</li>
					<li>About</li>
				</div>
				<div id="cover-content">
					
				</div>
			</div>
			<div id="tools"></div>
			<div id="funcbar">
				<div id='func'>
					<input id="cellname" class="cellname" spellcheck="false" onfocus="this.select()">
					<svg id='funcBarSizeChange' style="width: 20px;height: 10px;" t="1664582007721" class="icon" viewBox="0 0 1024 1024" version="1.1" xmlns="http://www.w3.org/2000/svg" p-id="1830" width="200" height="200"><path d="M512 256c70.4 0 128-57.6 128-128S582.4 0 512 0s-128 57.6-128 128 57.6 128 128 128z m0 128c-70.4 0-128 57.6-128 128s57.6 128 128 128 128-57.6 128-128-57.6-128-128-128z m0 384c-70.4 0-128 57.6-128 128s57.6 128 128 128 128-57.6 128-128-57.6-128-128-128z" p-id="1831" fill="#b3b3b3"></path></svg>
					<input id="finput" class="finput" spellcheck="false">
				</div>
			</div>
		</div>
		<div id="main-sheet"></div>
		<div id="foot">
			<div id='foot1'></div>
			<div id="scroll-x"><div id='scroll-x-length'>x</div></div>
			<div id='foot2'></div>
		</div>
		<div id="sheet"></div>
	</body>
	<script src="./Scripts/parse.js"></script>
	<script src="./Scripts/sheet.js"></script>
	<script src="./Scripts/init.js"></script>
	<script src="./Scripts/file.js"></script>
	<script src="./Scripts/bar.js"></script>
	<script src="./Scripts/keyboard.js"></script>
	<script src="./Scripts/jszip.min.js"></script>
	<script src="./Scripts/FileSaver.min.js"></script>
	<script src="./Scripts/formulas.js"></script>
	<script src="./Scripts/extra.js"></script>
	<script src="./Scripts/log.js"></script>
	<script src="./main.js"></script>
	<script src="./Scripts/Script-For-Application.js"></script>
	<script src="./Scripts/alert.js"></script>
</html>
